import React, { Component } from "react";

class FooterComponent extends Component {
  render() {
    return (
      <div>
        <div></div>
        <footer>
          <span className="text-muted">All Rights Reserved 2020 @techit</span>
        </footer>
      </div>
    );
  }
}

export default FooterComponent;
